# Given an integer array nums, return an array answer such that answer[i] is equal to the product of all the elements of nums except nums[i].
#
# The product of any prefix or suffix of nums is guaranteed to fit in a 32-bit integer.
#
# You must write an algorithm that runs in O(n) time and without using the division operation.
#
#
#
# Example 1:
#
# Input: nums = [1,2,3,4]
# Output: [24,12,8,6]
#
# Example 2:
#
# Input: nums = [-1,1,0,-3,3]
# Output: [0,0,9,0,0]
#
#
#
# Constraints:
#
# 2 <= nums.length <= 105
# -30 <= nums[i] <= 30
# The input is generated such that answer[i] is guaranteed to fit in a 32-bit integer.
#
#
#
# Follow up: Can you solve the problem in O(1) extra space complexity? (The output array does not count as extra space for space complexity analysis.)

import cProfile
import re
import math
class Solution:
    def product_except_self(self, nums: [int]) -> [int]:
        nums_len = len(nums)
        output = []

        if nums_len == 1:
            return nums_len

        product_right = [1]
        for index, num in enumerate(nums):
            if index == nums_len - 1:
                continue
            if index == 0:
                product_right.append(num)
                previous_value = num
            else:
                previous_value = previous_value * num
                product_right.append(previous_value)

        nums.reverse()
        product_left = [1]
        for index, num in enumerate(nums):
            if index == nums_len - 1:
                continue
            if index == 0:
                product_left.append(num)
                previous_value = num
            else:
                previous_value = previous_value * num
                product_left.append(previous_value)

        product_left.reverse()

        for index in range(0, len(nums)):
            output.append(product_right[index] * product_left[index])
        return output


